import React from "react";
import "./InputForm.css";

const InputForm = () => {
  const changeHandler = (e) => {
    console.log(e.target.value);
  };
  return (
    <form>
      <div className="form-container">
        <div className="form-element">
          <label htmlFor="item-title">Title</label>
          <input type="text" id="item-title" onKeyUp={changeHandler} />
        </div>
        <div className="form-element">
          <label htmlFor="item-price">Amount</label>
          <input type="number" id="item-price" min="1" />
        </div>
        <div className="form-element">
          <label htmlFor="date-title">Date</label>
          <input type="date" min="2019-12-01" max="2022-12-01" />
        </div>
        <div className="form-element button">
          <button type="submit" className="btn">
            Add Expense
          </button>
        </div>
      </div>
    </form>
  );
};

export default InputForm;
